 const getEntries = () =>   async (dispatch) => {
      const getData = async () => {
        try{
            const response = await fetch("http://localhost:8080/api/entry/");
            const data = await response.json()
           return data
        }
        catch(e){
            console.log(e)
        }
      }
    try{
        const entriesData = await getData()
        dispatch({type: "LOAD_ITEMS", payload: entriesData})

    }
    catch(e) {
        console.log(e)
        // add an error dispatch
    }


}
export default getEntries
